Step-by-step reasoning:

1. Key psychological mechanisms: Responders are likely to evaluate offers based on two issues. First, the absolute amount offered (split_self) matters. Second, deviations from a fairness benchmark (determined by each responder’s token-based contribution to the total combined earning) influence perceived fairness. When the offer is below the “fair” share (r), responders are expected to incur a penalty reflecting loss aversion or dissatisfaction.

2. Mechanism interaction: The model contrasts the actual offer (split_self) with a “fair” benchmark computed as 
  r = combined_earning × (token_self/(token_self + token_opp)).
An offer at or above the benchmark is valued solely by its log-transformed monetary amount, while offers below the benchmark incur an extra penalty proportional to the (log) discrepancy. Taking the logarithm of monetary amounts captures diminishing sensitivity (common in utility theory), and applying a penalty only when the offer is less than fair implements asymmetry (loss aversion).

3. Mathematical form: We use a logarithmic specification where the utility U of accepting an offer is given by:
  U = μ + ln(split_self) – λ × max{ln(r) – ln(split_self), 0}.
Here, μ is a baseline bias term and λ (lambda_param) scales the penalty for receiving an offer below the fairness benchmark. The use of max{⋅,0} ensures the penalty is applied only when ln(r) exceeds ln(split_self) (i.e. when split_self < r).

4. Learnable parameters and calibration: The model has two learnable parameters:
  • μ (mu): A baseline utility bias (with generous bounds, e.g. [–20, 20]).
  • λ (lambda_param): A fairness sensitivity parameter penalizing offers below the fairness benchmark (with bounds, e.g. [0, 20]).
These are the only free parameters, reducing potential covariance issues and enabling parameter recovery.

5. Mapping to observable behavior: All data variables (combined_earning, token_self, token_opp, and split_self) are used to compute r and the offer’s log value. Responders’ observed acceptance behavior is then predicted by the computed utility U; negative utilities correspond to unlikely acceptance.

Below is the formal model specification, variable descriptions, and a concise summary.

